import React from 'react';
import {Toggle} from "react-toggle-component"

export const ChartEntry = (props) => {
  let { chartEntries, buttonState, parentCallback} = props;
  if (chartEntries !== undefined) {
    return (
        <div>
          { chartEntries.myAP && chartEntries.myAP.map((entry, index) => {
            return (
              <label>
                    <p>{entry.AP_name}</p>
                    <Toggle name={entry.AP_name} onToggle={e=>{
                      console.log("BUTTONSTATE", buttonState[index], entry.AP_name);
                      buttonState[index]=!e.target.checked;
                      this.props.parentCallback(buttonState);
                    }}/>
                </label>
            )
          }) }
      </div>
    )
  } else {
    return (
      <div>
        <p> No Data to show </p>
      </div>
    )
  }
}
